articles/ts/基本类型.html.body:

Boolean
boolean作为最基础的数据类型，在JavaScript和TypeScript中被成为布尔值
  let isDone: boolean = false;
Number
和JavaScript一样，在TypeScript中所有的数字都是以浮点数或大整数(BigIntefer)表示。其中浮点数对应 number 类型, BigInteger对应 bigint 类型。除了十六进制和十进制，TypeScript还支持八进制和二进制。
let decimal: number = 6;
let hex: number = 0xf00d;
let binary: number = 0b1010;
let octal: number = 0o744;
let big: bigint = 100n;
String
在JavaScript和TypeScript中使用 string 类型表示文本类型,通过双引号 " 和 ' 来包裹字符数据
let color: string = 'blue';
color = 'red';
TypeScript同样支持模板字符串
let firstName: string = 'navigator';
let lastName: string = 'opera';
let fullName: string = `${firstName} ${lastName}`;
等价于
let fullName = firstName + ' ' + lastName;
Array
数组类型可以通过多种类型表示，第一种，使用 元素类型+[] 表示类型数组
let list: number[] = [1, 2, 3];
第二种是使用正常的数组类型：Array
let list: Array = [1, 2, 3];
Tuple
Tuple（元组）类型可以表示多种类型的数据，前提是数组长度固定。例如可以用字符串和数字表示一个数组。
// 声明一个数组
let x: [string, number];
// 初始化 （正确）
x = ['hello', 23];
// 初始化 （错误）
x = [23, 'hello'];
Type 'number' is not assignable to type 'string'.
Type 'string' is not assignable to type 'number'.
通过数组索引获取元素时，会检索元素的类型
console.log(x[0].substring(1)); // OK
console.log(x[1].substring[1]); // Error, 'number' does not have 'substring'
获取超出数组下标的元素会抛出错误
x[3] = "world"; // Error, Property '3' does not exist on type '[string, number]'.

Tuple type '[string, number]' of length '2' has no element at index '3'.

console.log(x[5].toString()); // Error, Property '5' does not exist on type '[string, number]'.

Object is possibly 'undefined'.
Tuple type '[string, number]' of length '2' has no element at index '5'.
Enum
enum是一个非常有用的数据类型，通过给定友好的命名来表示数值集合
enum Color {
  Red,
  Green,
  Blue
}
let c: Color = Color.Green; // 1
enum默认从 0 开始计数, 你也可以通过给其中一个或几个元素赋值。例如，你可以从 1 开始计数。
enum Color {
  Red = 1,
  Green,
  Blue,
}

let c: Color = Color.Green; // 2
也可以给所有元素赋值
enum Color {
  Red = 1,
  Green = 3,
  Blue = 12,
}

let c: Color = Color.Green; // 3
另一个好用的功能就是可以通过设置的元素值获取元素名称，例如
enum Color {
  Red = 1,
  Green,
  Blue,
}

let colorName: string = Color[2];

console.log(colorName); // Green
Any
如果不确定变量的类型，同时为了通过ts的类型检查，可以给这种元素标记为 any 类型
let notSure: any = 4;
notSure = 'maybe a string instead'; // ok
notSure = false; // ok

notSure.toFixed(); // ok, 编译器不会检查


let list: any[] = [1, true, 'dd'];
list[2] = 100; // [1, true, 100];
Void
当函数没有返回值时，可以加上 void 类型
function warnUser(): void{
  console.log('This is my warning message');
}
将一个变量时标记为 void 是没有意义的，因为你只可以给其赋值为 null (当且仅当 --strictNullChecks 为 false) 或者 undefined
let unusable: void = undefined;
unusable = nulll // OK if `--strictNullChecks` is not given
Null 和 Undefined
在typeScript中， null 和 undefined 拥有属于自己的类型，也就是 null 和 undefined
let u: undefined = undefined;
let n: null = null;
Never
never 类型用于表示抛出错误或者死循环函数的返回类型
function error(msg: string): never {
  throw new Error(msg);
}

function fail(msg: string) {
  return error(msg);
}

function infiniteLoop: never() {
  while(true) {}
}
Object
object 类型表示非基本类型，也就是非 number, string, boolean, symbol, null, undefined.
declare function create(o: object | null): void;

create({ prop: 0 }); // ok
create(null); // ok

create(42); // error

Argument of type '42' is not assignable to parameter of type 'object | null'. 

create('string'); // error

Argument of type '"string"' is not assignable to parameter of type 'object | null'. 

create(false); // Error

Argument of type 'false' is not assignable to parameter of type 'object | null'. 

create(undefined); // Error

Argument of type 'undefined' is not assignable to parameter of type 'object | null'.

assertions
断言类型会告诉编译器开发者明确当前的变量类型，不用做特别校验

尖括号形式

let someValue: any = 'some thing';
let length: number = (someValue).length;

as形式
let someValue: any = 'some thing';
let length: number = (someValue as string).length;

这两种形式是等价的，看个人喜好选择。不过在jsx中，只能使用 as 形式的断言。
断言的使用场景：当一个变量是联合类型时，只能使用该联合类型共有的属性或方法
function getLength(something: string | number): number {
    return something.length;
}

// index.ts(2,22): error TS2339: Property 'length' does not exist on type 'string | number'.
//   Property 'length' does not exist on type 'number'.
如果需要在还不确定类型的时候就访问其中一个类型的属性或方法，可以将变量断言为其中的一个类型（只能断言成联合类型中的类型）
function getLength(something: string | number): number {
    if ((something).length) {
        return (something).length;
    } else {
        return something.toString().length;
    }
}

或

function getLength(something: string | number): number {
    if ((something as string).length) {
        return (something as string).length;
    } else {
        return something.toString().length;
    }
}

articles/ts/接口.html.body:

Interfaces
介绍
TypeScript的核心原则之一就是聚焦[值的形状]的类型检查，有时这些值会被称为"鸭子类型"或者"结构子类型"(此处翻译原文：structural subtyping)。在TypeScript中，接口补充了命名这些类型的角色，同时也是约定项目内代码或者项目间代码的强有力方式。
值的形状解析：该词的意思就是一个对象所拥有的必要属性类型是固定的，由这个对象所生产的实例都有共同类型的属性。
const Person = function(name: string, age: number, hobbies: string[]) {
  this.name = name;
  this.age = age;
  this.hobbies = hobbies;
  return this;
}
Person 这个值的形状就是 name，age，hobbies
第一个接口
function printLabel(labeledObj: { label: string }) {
  console.log(labeledObj.label);
}

let myObj = {size: 10, label: 'Size 10 Object'};
printLabel(myObj);
类型检查器检查 printLabel 的调用, 该函数接收一个参数，该参数要求是一个带有 label 属性且属性类型为 string 的对象。
请注意，我们的对象实际上有比这更多的属性，但是编译器只检查并匹配所需的类型。
下面用接口来重写上面的代码
interface LabeledValue {
  label: string;
}
function printLabel(labeledObj: LabeledValue) {
  console.log(labeledObj.label);
}

let myObj = {size: 10, label: 'Size 10 Object'};
printLabel(myObj);
我们可以通过接口 labeledValue 来描述上一个例子中的必要条件。它同样表示有一个 string 类型的属性 label,注意我们没有明确表示传给 printLabel 的对象需要像其他语言一样继承该接口，在这里，它仅仅表示[值的形状],如果传给 printLabel 函数的对象满足接口的必要条件(也就是拥有 string 类型的 label 属性)，那么检查就会通过.
可选属性
接口中的所有属性不是都必须的，有些属性在某些条件下存在或者不存在。当传给函数的对象只拥有一部分属性时，可选属性会非常有用。
interface SquareConfig {
  color?: string;
  width?: number;
}

function createSquare(config: SquareConfig): {color: string, area: number} {
  let newSquare = {color: 'white', area: 100};
  if (config.color) {
    newSquare.color = config.color;
  }
  if (config.width) {
    newSquare.width = Math.pow(config.width, 2);
  }
  return newSquare;
}

let mySquare = createSquare({color: 'pink'});
具有可选属性的接口的编写方式与其他接口类似，在声明中的属性名称的末尾以 ? 表示。
可选属性的优点在于，您可以描述这些可能可用的属性，同时仍然可以防止使用不属于接口的属性。 例如，如果我们在createSquare中错误输入了color属性的名称，则会抛出错误
interface SquareConfig {
    color?: string;
    width?: number;
}

function createSquare(config: SquareConfig): { color: string; area: number } {
    let newSquare = {color: "white", area: 100};
    if (config.clor) {
        // Error: Property 'clor' does not exist on type 'SquareConfig'
        newSquare.color = config.clor;
    }
    if (config.width) {
        newSquare.area = config.width * config.width;
    }
    return newSquare;
}

let mySquare = createSquare({color: "black"});
只读属性
某些属性仅在首次创建对象时才可以修改。 可以通过在属性名称前放置只读字符 readonly 来指定
interface Point {
  readonly x: number;
  readonly y: number;
}
创建一个 Ponit 类型的对象，创建之后，x 和 y 属性不能变更。
let p1: Point = {x: 10, y: 20};
p1.x = 1; // error
TypeScript中的 ReadonlyArray 类型和 Array 类型一样，只不过是去除了所有能改变该数组的方法，所以你可以非常确信数组创建之后不会被改变。
let a: number[] = [1, 2, 3, 4];
let b: number[] = [3, 4];
let ro: ReadonlyArray = a;
let ro2: ReadonlyArray = b;
ro[0] = 12; // error!
ro.push(5); // error!
ro.length = 100; // error!
a = ro; // error!
ro2 = ro; // OK
最后一行 a = ro，将只读数组赋值给 非只读 数组（不过可以赋值给只读数组），如果想把只读数组赋值给非只读数组，可以使用断言。
a = ro as number[];
readonly vs const
区别何时使用 readonly 和 const 的最简单方式：变量使用 const, 属性使用 readonly
 const cs = null;
 interface Ro {
   readonly width: number;
 }
过度的属性校验
 先来看一个例子
 interface O {
  color?: string;
  width?: number;
}


function createO(o: O): void {
  console.log(o.color);
}

createO({name: 'ddd', width: 23}); // error

const demo = {name: 'ddd', width: 23}; 
createO(demo); // ok
上面例子中，直接给 createO 传递 对象字面量 会抛出错误（错误原因：name 属性不在接口O定义的属性列表内）,而下面的demo则不会出错。这是因为typeScript会对直接传递给函数或变量的对象字面量特殊校验，如果对象中拥有类型中不存在的属性，就会抛出错误。
绕过检查很简单，可以将对象字面量断言成检查的类型
createO({name: 'dd', width: 23} as O)
不过，更好的处理方式是使用 字符串索引签名(我翻译为：预定义属性),如果你确认接口除了确认属性外还有额外的其他属性，使用该方式更优雅
interface SquareConfig {
  color?: string;
  width?: number;
  [propName: string]: any; //字符串索引签名
}
有了预定义属性，SquareConfig 就有了任意多的属性，再也不用担心属性不存在的错误了。
函数类型
接口除了可以描述一个对象类型外，也可以表示函数类型
interface SearchFunc {
  (source: string, subString: string): boolean;
}
和使用 Object 类型接口一样
let mySearch: SearchFunc;
mySearch = function(source: string, subString: string) {
    let result = source.search(subString);
    return result > -1;
}
函数入参可以自定义，不过 参数类型和数量要和接口保持一致
let mySearch: SearchFunc;
mySearch = function(src: string, sub: string): boolean {
    let result = src.search(sub);
    return result > -1;
}
我们也可以不指定参数类型，typeScript会通过神奇的[类型推断]实现类型的自动判断，返回值类型也是同样的道理。如果参数类型或返回值类型不符合接口定义，typeScript会抛出错误。
let mySearch: SearchFunc;
mySearch = function(src, sub) {
    let result = src.search(sub);
    return result > -1;
}

// 错误的返回值类型
// error: Type '(src: string, sub: string) => string' is not assignable to type 'SearchFunc'.
// Type 'string' is not assignable to type 'boolean'.
mySearch = function(src, sub) {
    let result = src.search(sub);
    return 'string';
}
可变索引类型
类型特点：

包含索引字段
索引类型只能是 number 和 string, 当两个类型混用时, number 类型的返回值必须是 string 类型返回值的子类型
返回值类型相同，也可以是组合类型

index 为 number 类型时，常用于数组
interface StringArray {
    [index: number]: string;
}

let myArray: StringArray;
myArray = ["Bob", "Fred"];

let myStr: string = myArray[0]; //
index 为 string 类型时，常用于对象
interface StringObject {
  [index: string]: number;
}

const myObj: StringObject = {
  a: 1,
  b: 2,
  c: 3
}
返回值类型为组合类型
interface NumberOrStringDictionary {
    [index: string]: number | string;
    length: number;    // ok, length is a number
    name: string;      // ok, name is a string
}
索引类型也可以应用 readonly 关键字
interface ReadonlyStringArray {
    readonly [index: number]: string;
}
let myArray: ReadonlyStringArray = ["Alice", "Bob"];
myArray[2] = "Mallory"; // error!
class 类型
接口继承,就像 Java 和 c# 一样
interface ClockInterface {
    currentTime: Date; // 定义属性
    setTime(d: Date): void; // 定义方法, 子类必须实现
}

class Clock implements ClockInterface {
    currentTime: Date = new Date();
    setTime(d: Date) {
        this.currentTime = d;
    }
    constructor(h: number, m: number) { }
}
